/*
Given a string, find the length of the longest substring T that contains at most k distinct characters.

For example, Given s = “eceba” and k = 2,

T is "ece" which its length is 3.
*/

/*
"eceba"
2
"baece"
2
"aaaaaaaabcd"
3
""
3
"asdb"
0
"aaaaabdc"
1
"abcb"
3
"a"
1
"aaaaa"
1
"ab"
2
""
34
*/
int lengthOfLongestSubstringKDistinct(string s, int k) {

		//transform(s.begin(), s.end(), s.begin(), (int(*)(int))tolower);
	
		if (k == 0 || s == "")
			return 0;
	
		if (s.length() == 1 && k > 0)
			return 1;
	
		map<char, int> charCount;
		int numChars = 1;
		int head = 0;
		int tail = 0;
		charCount[s[0]] = 1;


		while (tail < s.length() - 1)
		{
			char newChar = s[tail + 1];

			if (charCount[newChar] > 0)
			{
				tail++;
				charCount[newChar]++;
			}
			else
			{
				numChars++;
				tail++;
				charCount[newChar] = 1;

				while (numChars > k)
				{
					head++;
					charCount[s[head-1]]--;
					if (charCount[s[head-1]] == 0)
						numChars--;

					if (numChars <= k)
						break;

					tail++;
					if (tail == s.length() - 1)
						return tail-1 - head + 1;

					if (charCount[s[tail]] > 0)
						charCount[s[tail]]++;
					else
					{
						charCount[s[tail]] = 1;
						numChars++;
					}
				}
			}

		}

		return tail - head + 1;
}


